import './App.css'
import React, { Component } from 'react'
import Customer from './components/Customer'
import { Table } from '@mui/material'
import { TableHead } from '@mui/material'
import { TableBody } from '@mui/material'
import { TableRow } from '@mui/material'
import { TableCell } from '@mui/material'

const customers = [
  {
    name: '홍길동',
    birthday: '901111',
    gender: '남자',
    job: '대학생',
    image: 'https://placeimg.com/195/195/1',
    id: 1,
  },
  {
    name: '홍두깨',
    birthday: '781111',
    gender: '남자',
    job: '개발자',
    image: 'https://placeimg.com/195/195/2',
    id: 2,
  },
  {
    name: '김철수',
    birthday: '581111',
    gender: '남자',
    job: '기술자',
    image: 'https://placeimg.com/195/195/3',
    id: 3,
  },
]

class App extends Component {
  render() {
    return (
      <div className="App">
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>번호</TableCell>
              <TableCell>이미지</TableCell>
              <TableCell>이름</TableCell>
              <TableCell>생년월일</TableCell>
              <TableCell>성별</TableCell>ㄴ<TableCell>직업</TableCell>ㄴ
            </TableRow>
            ㄴ
          </TableHead>
          <TableBody>
            {customers.map((c) => {
              return (
                <Customer
                  key={c.id}
                  id={c.id}
                  name={c.name}
                  birthday={c.birthday}
                  gender={c.gender}
                  job={c.job}
                  image={c.image}
                />
              )
            })}
          </TableBody>
        </Table>
      </div>
    )
  }
}

export default App
